import List from '../../componetes/TransitionsList';
import Resume from '../../componetes/Resumo';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <List />
        <div>
          <Resume />
        </div>

      </main>
    </div>
  );
}

export default App;
